import Button from "./Button";
import Header from "./Header";
import Inputs from "./Inputs";
import Options from "./Options";

export default function Form({
  amount,
  term,
  interest,
  isRepeymentSelected,
  isInterestSelected,
}) {
  return (
    <div className="left">
      <form action="">
        <Header />
        <div className="form-groups">
          <Inputs amount={amount} term={term} interest={interest} />
          <Options
            isRepeymentSelected={isRepeymentSelected}
            isInterestSelected={isInterestSelected}
          />
        </div>
        <Button />
      </form>
    </div>
  );
}
